import * as React from "react";
import { Searchbar } from "rea";

export default class SearchBar extends React.Component {
  state = {
    firstQuery: ""
  };

  render() {
    const { firstQuery } = this.state;
    return (
      <Searchbar
        placeholder="Search"
        onChangeText={query => {
          this.setState({ firstQuery: query });
        }}
        value={firstQuery}
      />
    );
  }
}
